    "# 1. Membaca data1.csv dan mencari nilai species untuk id 57\n",
    "def find_species_for_id(file_path, id_value):\n",
    "    df = pd.read_csv(file_path)\n",
    "    species_value = df.loc[df['id'] == id_value, 'species'].iloc[0]\n",
    "    return species_value"
